        /// transitionRoute(path)
        // Handle transitions between routes
        //
        function transitionRoute(path) {
            // grab the config object to get the form element and controller
            var formRoute = routeMap[path];
            var currentUser = rootRef.getAuth();

            //// definir _userLang
            //"" != getAccessToken() && _userLang != getAccessToken().split("¦")[7] && "" != getAccessToken().split("¦")[7] && (_userLang = getAccessToken().split("¦")[7]);

            // if authentication is required and there is no
            // current user then go to the register page and
            // stop executing
            if (formRoute.authRequired && !currentUser) {
                html.push("<div class=\"container\">\n<div class=\"navbar-header\">\n<button class=\"navbar-toggle collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\".bs-navbar-collapse\">\n<span class=\"sr-only\">Toggle navigation</span>\n<span class=\"icon-bar\"></span>\n<span class=\"icon-bar\"></span>\n<span class=\"icon-bar\"></span>\n</button> <a href=\"#\" class=\"navbar-brand\">td-epu Logo</a>\n</div>\n<nav class=\"collapse navbar-collapse bs-navbar-collapse\" role=\"navigation\">\n<ul class=\"nav navbar-nav\">\n");
                html.push("<li>\n<a href=\"#/\">Login</a>\n</li>\n</ul>\n</nav>\n</div>\n");    // ??
                $("#top").html(html.join(""));                                                  // ??
                routeTo('register');
                return;
            }
      
            //var categoria = !currentUser ? (path == "#/" ? "Login" : "About") : currentUser.category;
            var _categoria = void 0;
            //var _form = formRoute.form;
            //var _controller = formRoute.controller;

            switch (path) {
                case "#/":
                    _categoria = "Login";
                    break;
                case "#/about":
                    _categoria = "About";
                    break;
                //case "#/languages":
                //    _form = activeForm.attr("Id");
                //    _controller = _form.charAt(3).toLowerCase() + _form.slice(4);
                //    _categoria = _form.slice(3);
                //    _userLang = _userLang === "es" ? "en" : "es";
                //    break;
                default:
                    if (currentUser)
                        categoria = currentUser.category;
                    break;
            }

            // load menu 
            $("#top").html(getMenu(_categoria));
                      
            // load form
            $("#container").html(getForm(formRoute.form));
            //$("#container").html(getForm(_form));

            // wrap the upcoming form in jQuery
            var upcomingForm = $('#' + formRoute.form);
            //var upcomingForm = $('#' + _form);

            // if there is no active form then make the current one active
            if (!activeForm) {
                activeForm = upcomingForm;
            }

            // hide old form and show new form
            activeForm.hide();
            upcomingForm.show().hide().fadeIn(750);

            // remove any listeners on the soon to be switched form
            activeForm.off();

            // set the new form as the active form
            activeForm = upcomingForm;

            // invoke the controller
            controllers[formRoute.controller](activeForm);
            //controllers[_controller](activeForm);
        }

